  public int runJobInTOS(String[] args) {
    // reset status
    status = "";

    String lastStr = "";
    for (String arg : args) {
      if (arg.equalsIgnoreCase("--context_param")) {
        lastStr = arg;
      } else if (lastStr.equals("")) {
        evalParam(arg);
      } else {
        evalParam(lastStr + " " + arg);
        lastStr = "";
      }
    }

    if (clientHost == null) {
      clientHost = defaultClientHost;
    }

    if (pid == null || "0".equals(pid)) {
      pid = TalendString.getAsciiRandomString(6);
    }

    if (rootPid == null) {
      rootPid = pid;
    }
    if (fatherPid == null) {
      fatherPid = pid;
    } else {
      isChildJob = true;
    }

    if (portStats != null) {
      // portStats = -1; //for testing
      if (portStats < 0 || portStats > 65535) {
        // issue:10869, the portStats is invalid, so this client socket can't open
        System.err.println("The statistics socket port " + portStats + " is invalid.");
        execStat = false;
      }
    } else {
      execStat = false;
    }

    try {
      // call job/subjob with an existing context, like: --context=production. if without this
      // parameter, there will use the default context instead.
      java.io.InputStream inContext =
          UserMigrationUpdateChannel.class
              .getClassLoader()
              .getResourceAsStream(
                  "userexternalidmigration/usermigrationupdatechannel_0_1/contexts/"
                      + contextStr
                      + ".properties");
      if (inContext == null) {
        inContext =
            UserMigrationUpdateChannel.class
                .getClassLoader()
                .getResourceAsStream("config/contexts/" + contextStr + ".properties");
      }
      if (inContext != null) {
        // defaultProps is in order to keep the original context value
        defaultProps.load(inContext);
        inContext.close();
        context = new ContextProperties(defaultProps);
      } else if (!isDefaultContext) {
        // print info and job continue to run, for case: context_param is not empty.
        System.err.println("Could not find the context " + contextStr);
      }

      if (!context_param.isEmpty()) {
        context.putAll(context_param);
        // set types for params from parentJobs
        for (Object key : context_param.keySet()) {
          String context_key = key.toString();
          String context_type = context_param.getContextType(context_key);
          context.setContextType(context_key, context_type);
        }
      }
      context.setContextType("sunbird_cassandra_keyspace", "id_String");

      context.sunbird_cassandra_keyspace =
          (String) context.getProperty("sunbird_cassandra_keyspace");
      context.setContextType("sunbird_cassandra_password", "id_Password");

      String pwd_sunbird_cassandra_password_value =
          context.getProperty("sunbird_cassandra_password");
      context.sunbird_cassandra_password = null;
      if (pwd_sunbird_cassandra_password_value != null) {
        if (context_param.containsKey(
            "sunbird_cassandra_password")) { // no need to decrypt if it come from program argument
                                             // or parent job runtime
          context.sunbird_cassandra_password = pwd_sunbird_cassandra_password_value;
        } else if (!pwd_sunbird_cassandra_password_value.isEmpty()) {
          try {
            context.sunbird_cassandra_password =
                routines.system.PasswordEncryptUtil.decryptPassword(
                    pwd_sunbird_cassandra_password_value);
            context.put("sunbird_cassandra_password", context.sunbird_cassandra_password);
          } catch (java.lang.RuntimeException e) {
            // do nothing
          }
        }
      }
      context.setContextType("sunbird_cassandra_port", "id_String");

      context.sunbird_cassandra_port = (String) context.getProperty("sunbird_cassandra_port");
      context.setContextType("sunbird_cassandra_server", "id_String");

      context.sunbird_cassandra_server = (String) context.getProperty("sunbird_cassandra_server");
      context.setContextType("sunbird_cassandra_username", "id_String");

      context.sunbird_cassandra_username =
          (String) context.getProperty("sunbird_cassandra_username");
      context.setContextType("sunbird_channel_migration_log_file", "id_String");

      context.sunbird_channel_migration_log_file =
          (String) context.getProperty("sunbird_channel_migration_log_file");
    } catch (java.io.IOException ie) {
      System.err.println("Could not load context " + contextStr);
      ie.printStackTrace();
    }

    // get context value from parent directly
    if (parentContextMap != null && !parentContextMap.isEmpty()) {
      if (parentContextMap.containsKey("sunbird_cassandra_keyspace")) {
        context.sunbird_cassandra_keyspace =
            (String) parentContextMap.get("sunbird_cassandra_keyspace");
      }
      if (parentContextMap.containsKey("sunbird_cassandra_password")) {
        context.sunbird_cassandra_password =
            (java.lang.String) parentContextMap.get("sunbird_cassandra_password");
      }
      if (parentContextMap.containsKey("sunbird_cassandra_port")) {
        context.sunbird_cassandra_port = (String) parentContextMap.get("sunbird_cassandra_port");
      }
      if (parentContextMap.containsKey("sunbird_cassandra_server")) {
        context.sunbird_cassandra_server =
            (String) parentContextMap.get("sunbird_cassandra_server");
      }
      if (parentContextMap.containsKey("sunbird_cassandra_username")) {
        context.sunbird_cassandra_username =
            (String) parentContextMap.get("sunbird_cassandra_username");
      }
      if (parentContextMap.containsKey("sunbird_channel_migration_log_file")) {
        context.sunbird_channel_migration_log_file =
            (String) parentContextMap.get("sunbird_channel_migration_log_file");
      }
    }

    // Resume: init the resumeUtil
    resumeEntryMethodName = ResumeUtil.getResumeEntryMethodName(resuming_checkpoint_path);
    resumeUtil = new ResumeUtil(resuming_logs_dir_path, isChildJob, rootPid);
    resumeUtil.initCommonInfo(
        pid, rootPid, fatherPid, projectName, jobName, contextStr, jobVersion);

    List<String> parametersToEncrypt = new java.util.ArrayList<String>();
    parametersToEncrypt.add("sunbird_cassandra_password");
    // Resume: jobStart
    resumeUtil.addLog(
        "JOB_STARTED",
        "JOB:" + jobName,
        parent_part_launcher,
        Thread.currentThread().getId() + "",
        "",
        "",
        "",
        "",
        resumeUtil.convertToJsonText(context, parametersToEncrypt));

    if (execStat) {
      try {
        runStat.openSocket(!isChildJob);
        runStat.setAllPID(rootPid, fatherPid, pid, jobName);
        runStat.startThreadStat(clientHost, portStats);
        runStat.updateStatOnJob(RunStat.JOBSTART, fatherNode);
      } catch (java.io.IOException ioException) {
        ioException.printStackTrace();
      }
    }

    java.util.concurrent.ConcurrentHashMap<Object, Object> concurrentHashMap =
        new java.util.concurrent.ConcurrentHashMap<Object, Object>();
    globalMap.put("concurrentHashMap", concurrentHashMap);

    long startUsedMemory = Runtime.getRuntime().totalMemory() - Runtime.getRuntime().freeMemory();
    long endUsedMemory = 0;
    long end = 0;

    startTime = System.currentTimeMillis();

    this.globalResumeTicket = true; // to run tPreJob

    this.globalResumeTicket = false; // to run others jobs

    try {
      errorCode = null;
      tCassandraConnection_1Process(globalMap);
      if (!"failure".equals(status)) {
        status = "end";
      }
    } catch (TalendException e_tCassandraConnection_1) {
      globalMap.put("tCassandraConnection_1_SUBPROCESS_STATE", -1);

      e_tCassandraConnection_1.printStackTrace();
    }

    this.globalResumeTicket = true; // to run tPostJob

    end = System.currentTimeMillis();

    if (watch) {
      System.out.println((end - startTime) + " milliseconds");
    }

    endUsedMemory = Runtime.getRuntime().totalMemory() - Runtime.getRuntime().freeMemory();
    if (false) {
      System.out.println(
          (endUsedMemory - startUsedMemory)
              + " bytes memory increase when running : UserMigrationUpdateChannel");
    }

    if (execStat) {
      runStat.updateStatOnJob(RunStat.JOBEND, fatherNode);
      runStat.stopThreadStat();
    }
    int returnCode = 0;
    if (errorCode == null) {
      returnCode = status != null && status.equals("failure") ? 1 : 0;
    } else {
      returnCode = errorCode.intValue();
    }
    resumeUtil.addLog(
        "JOB_ENDED",
        "JOB:" + jobName,
        parent_part_launcher,
        Thread.currentThread().getId() + "",
        "",
        "" + returnCode,
        "",
        "",
        "");

    return returnCode;
  }

