  private void evalParam(String arg) {
    if (arg.startsWith("--resuming_logs_dir_path")) {
      resuming_logs_dir_path = arg.substring(25);
    } else if (arg.startsWith("--resuming_checkpoint_path")) {
      resuming_checkpoint_path = arg.substring(27);
    } else if (arg.startsWith("--parent_part_launcher")) {
      parent_part_launcher = arg.substring(23);
    } else if (arg.startsWith("--watch")) {
      watch = true;
    } else if (arg.startsWith("--stat_port=")) {
      String portStatsStr = arg.substring(12);
      if (portStatsStr != null && !portStatsStr.equals("null")) {
        portStats = Integer.parseInt(portStatsStr);
      }
    } else if (arg.startsWith("--trace_port=")) {
      portTraces = Integer.parseInt(arg.substring(13));
    } else if (arg.startsWith("--client_host=")) {
      clientHost = arg.substring(14);
    } else if (arg.startsWith("--context=")) {
      contextStr = arg.substring(10);
      isDefaultContext = false;
    } else if (arg.startsWith("--father_pid=")) {
      fatherPid = arg.substring(13);
    } else if (arg.startsWith("--root_pid=")) {
      rootPid = arg.substring(11);
    } else if (arg.startsWith("--father_node=")) {
      fatherNode = arg.substring(14);
    } else if (arg.startsWith("--pid=")) {
      pid = arg.substring(6);
    } else if (arg.startsWith("--context_type")) {
      String keyValue = arg.substring(15);
      int index = -1;
      if (keyValue != null && (index = keyValue.indexOf('=')) > -1) {
        if (fatherPid == null) {
          context_param.setContextType(
              keyValue.substring(0, index), replaceEscapeChars(keyValue.substring(index + 1)));
        } else { // the subjob won't escape the especial chars
          context_param.setContextType(keyValue.substring(0, index), keyValue.substring(index + 1));
        }
      }

    } else if (arg.startsWith("--context_param")) {
      String keyValue = arg.substring(16);
      int index = -1;
      if (keyValue != null && (index = keyValue.indexOf('=')) > -1) {
        if (fatherPid == null) {
          context_param.put(
              keyValue.substring(0, index), replaceEscapeChars(keyValue.substring(index + 1)));
        } else { // the subjob won't escape the especial chars
          context_param.put(keyValue.substring(0, index), keyValue.substring(index + 1));
        }
      }
    } else if (arg.startsWith("--log4jLevel=")) {
      log4jLevel = arg.substring(13);
    }
  }

  private static final String NULL_VALUE_EXPRESSION_IN_COMMAND_STRING_FOR_CHILD_JOB_ONLY =
      "<TALEND_NULL>";

  private final String[][] escapeChars = {
    {"\\\\", "\\"},
    {"\\n", "\n"},
    {"\\'", "\'"},
    {"\\r", "\r"},
    {"\\f", "\f"},
    {"\\b", "\b"},
    {"\\t", "\t"}
  };

  private String replaceEscapeChars(String keyValue) {

    if (keyValue == null || ("").equals(keyValue.trim())) {
      return keyValue;
    }

    StringBuilder result = new StringBuilder();
    int currIndex = 0;
    while (currIndex < keyValue.length()) {
      int index = -1;
      // judege if the left string includes escape chars
      for (String[] strArray : escapeChars) {
        index = keyValue.indexOf(strArray[0], currIndex);
        if (index >= 0) {

          result.append(
              keyValue
                  .substring(currIndex, index + strArray[0].length())
                  .replace(strArray[0], strArray[1]));
          currIndex = index + strArray[0].length();
          break;
        }
      }
      // if the left string doesn't include escape chars, append the left into the result
      if (index < 0) {
        result.append(keyValue.substring(currIndex));
        currIndex = currIndex + keyValue.length();
      }
    }

    return result.toString();
  }

